import React, { useEffect } from "react";
import "../../assets/css/compeounder.css";
import "../../assets/css/innerstyle.css";
import "../../assets/css/bootstrap/dist/css/bootstrap.min.css";
import "../../assets/css/bootstrap/js"

const TabNavigation = () => {
  useEffect(() => {
    // Ensure Bootstrap's JavaScript is initialized
    const bootstrap = require("../../assets/css/bootstrap/dist/js/bootstrap.bundle.min.js");
  }, []);

  return (
    <ul className="nav nav-tabs" id="myTab" role="tablist">
      <li className="nav-item" role="presentation">
        <button
          className="nav-link active"
          id="KeyWebsite-tab"
          data-bs-toggle="tab"
          data-bs-target="#KeyWebsite"
          type="button"
          role="tab"
          aria-controls="KeyWebsite"
          aria-selected="true"
        >
          Key Website
        </button>
      </li>
      <li className="nav-item" role="presentation">
        <button
          className="nav-link"
          id="E-Book-tab"
          data-bs-toggle="tab"
          data-bs-target="#E-Book"
          type="button"
          role="tab"
          aria-controls="E-Book"
          aria-selected="false"
        >
          E-Book/Guide
        </button>
      </li>
      <li className="nav-item" role="presentation">
        <button
          className="nav-link"
          id="Blog-tab"
          data-bs-toggle="tab"
          data-bs-target="#Blog"
          type="button"
          role="tab"
          aria-controls="Blog"
          aria-selected="false"
        >
          Blog
        </button>
      </li>
      <li className="nav-item" role="presentation">
        <button
          className="nav-link"
          id="RFAQtab"
          data-bs-toggle="tab"
          data-bs-target="#RFAQ"
          type="button"
          role="tab"
          aria-controls="RFAQ"
          aria-selected="false"
        >
          FAQ
        </button>
      </li>
      <li className="nav-item" role="presentation">
        <button
          className="nav-link"
          id="Support-tab"
          data-bs-toggle="tab"
          data-bs-target="#Support"
          type="button"
          role="tab"
          aria-controls="Support"
          aria-selected="false"
        >
          Support
        </button>
      </li>
    </ul>
  );
};

export default TabNavigation;
